import React from "react";
import "./styles.scss";

export function Header() {
  return (
    <div className="header">
      <div className="header__links">
        <h1>Shortly</h1>
        <p>Features</p>
        <p>Pricing</p>
        <p>Ressources</p>
      </div>
      <div className="header__auth">
        <h1>Shortly</h1>
        <p>Features</p>
        <p>Pricing</p>
        <p>Ressources</p>
      </div>
    </div>
  );
}
